import React from "react";
import Entry from "./Entry";

function createEntry(emoji){
  return(
    <Entry key="emoji.id" />
  );
};

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>

      <dl className="dictionary">
        <Entry />

      </dl>
    </div>
  );
}

export default App;
